69DQhBGZ\\/yYvp5UomkzNqRwiBw+E4X1RU1BeLxRZMPk4pRV1d3Z7Vq1e\\/LYTgZn9qSbkAeL3emZctrNbBwcHBM5PlKioquupyuT5vbGzcK4QA5xyEECmX2QMwmw1mwzCwcOHC\\/cFgcB1jDCUlJX8QQo643e6fhRBhxhjk+87uetrLYEgeFnLjWiLlkki5JBIpl0TKJZFySSRSLomUSzIX+HsADpemd3BhI6QAAAAASUVORK5CYII=\\\" data-filename=\\\"002.png\\\" style=\\\"font-size: 12px; margin: 10px; width: 105.841px; height: 29.4392px;\\\"><br><\\/span><\\/h1><h5 style=\\\"color: rgb(64, 64, 64); text-align: justify; line-height: 1.4;\\\">A thing that is close to heart is the most difficult to tell in one sitting! Yet at times stories need no telling. So lets cut the chase, get to business! Our ideal is simple, it is about a good life, a promise of it! Be assured that we come with heart full of \\u2018living juice\\u2019 of good intentions and commitment to deliver the experiential best. For we believe, we can argue on a theory, but not on a personal experience. With us, you will experience a good life. Of many tall people we look up to, we like this definition of success by our beloved essayist and poet, Ralph Waldo Emerson. To laugh often and much; To win the respect of intelligent people and the affection of children; To earn the appreciation of honest critics and endure the betrayal of false friends; To appreciate beauty, to find the best in others; To leave the world a bit better, whether by a healthy child, a garden patch, or a redeemed social condition; To know even one life has breathed easier because you have lived. This is to have succeeded.<\\/h5><h5 style=\\\"color: rgb(64, 64, 64); text-align: justify; line-height: 1.4;\\\"><br><\\/h5><h5 style=\\\"color: rgb(64, 64, 64); text-align: justify; line-height: 1.4;\\\"><br><\\/h5><h5 style=\\\"color: rgb(64, 64, 64); text-align: justify; line-height: 1.4;\\\"><br><\\/h5><\\/div><div style=\\\"text-align: justify;\\\"><br><\\/div><div style=\\\"text-align: justify;\\\"><br><\\/div><div style=\\\"text-align: justify;\\\"><br><\\/div><\\/h1><img src=\\\"data:image\\/png;base64,iVBORw0K